def np(p):
    no = p.replace('1', '')

    pos = p.index(no)

    p = list(p)

    if no == '2':
        p[pos] = '3'
    elif no == '3':
        p[pos] = '5'
    elif no == '5':
        p[pos] = '7'
    else:
        if pos == 0:
            return '1' * len(p) + '2'
        else:
            p[pos] = '1'
            p[pos - 1] = '2'

    return ''.join(p)

